        public async static void SendSMSMessage(String phoneNumber, String messageBody, TemplatedPage context)
        {
            phoneNumber = phoneNumber.Trim().Replace(" ", "");
            string url = "https://api.twilio.com/2010-04-01/Accounts/AC6ffb66b3cd44ee6382966349e7f1cf20/Messages.json";

            using (var handle = new HttpClientHandler())
            {
                handle.Credentials = new System.Net.NetworkCredential("AC6ffb66b3cd44ee6382966349e7f1cf20", "5f69fbff09e38ebc5687b88c75070633");
                using (var client = new HttpClient(handle))
                {
                    var requestContent = new FormUrlEncodedContent(new[]
                    {
                        new KeyValuePair<string, string>("To", phoneNumber.Trim()),
                        new KeyValuePair<string, string>("From", "+14155239121"),
                        new KeyValuePair<string, string>("Body", messageBody.Trim())
                    });

                    HttpResponseMessage msm = await client.PostAsync(url, requestContent);
                    await context.DisplayAlert("Notice", msm.ReasonPhrase, "Close");
                }
            }
        }

        private async void browserBtn_Clicked(object sender, EventArgs e)
        {
            await BrowseForImage();
        }

        private async Task BrowseForImage()
        {
            var file = await CrossFilePicker.Current.PickFile();

            if (file != null)
            {
                byte[] data = file.DataArray;
                string myimageTobase64 = System.Convert.ToBase64String(data);

                ImageManagement Convert = new ImageManagement();
                PictureBox.Source = Convert.ByteArrayToImageSource(myimageTobase64);
                imageAdd = myimageTobase64;

            }
        }

        private async void CheckInUSersTable()
        {
            if (!isPhoneNumberExisting)
            {
                if (LoadDataOffline.AllUsersDictionary != null)
                {
                    foreach (var onePhone in LoadDataOffline.AllUsersDictionary)
                    {
                        if (onePhone.Value.PhoneNumber.Equals(phoneRegister))
                        {
                            isPhoneNumberExisting = true;
                            break;
                        }
                    }
                }
            }
        }
